function onChange(n){HttpGet(`/PossessionDetail/GetKhasraList/?villageId=${n}`,"json",function(n){for(var i='<option value="">Select<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#KhasraId").select2("val","");$("#KhasraId").html(i)})}$("#KhasraId").change(function(){var n=$(this).val();n&&HttpGet(`/PossessionDetail/GetAreaList/?khasraid=${n}`,"json",function(n){$("#Bigha").val(n.bigha);$("#Biswa").val(n.biswa);$("#Biswanshi").val(n.biswanshi)})});$("input[name='IsVacant']").click(function(){$("#IsVacant").is(":checked")?$("#PossType").val("Vacant"):$("#PossType").val("");$(".chkAction:checkbox:checked").each(function(){var n=$(this).attr("id");$("#PossType").val(n)})});$("input[name='IsBuiltup']").click(function(){$("#IsBuiltup").is(":checked")?$("#PossType").val("Built Up"):$("#PossType").val("");$(".chkAction:checkbox:checked").each(function(){var n=$(this).attr("id");$("#PossType").val(n)})});